  CONSTRAINT `fk_embarque_mercaderia1` FOREIGN KEY (`mercaderia`) REFERENCES `mercaderia` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=244 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;
