--
-- Table structure for table `personal`
--

DROP TABLE IF EXISTS `personal`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `personal` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `apellido` varchar(128) COLLATE utf8_spanish_ci DEFAULT NULL,
  `nombres` varchar(128) COLLATE utf8_spanish_ci DEFAULT NULL,
  `registro` varchar(10) COLLATE utf8_spanish_ci DEFAULT NULL,
  `cuil` varchar(13) COLLATE utf8_spanish_ci DEFAULT NULL,
  `categoria_principal` int(11) DEFAULT NULL,
  `nro_afiliado` int(11) DEFAULT NULL COMMENT '	',
  `documento` varchar(10) COLLATE utf8_spanish_ci DEFAULT NULL,
  `sindicato` tinyint(1) DEFAULT NULL,
  `domicilio` varchar(256) COLLATE utf8_spanish_ci DEFAULT NULL,
  `fecha_nacimiento` date DEFAULT NULL,
  `obra_social` int(11) DEFAULT NULL,
  `ingreso` date DEFAULT NULL,
  `localidad` varchar(45) COLLATE utf8_spanish_ci DEFAULT NULL,
  `cuenta_bancaria` varchar(45) COLLATE utf8_spanish_ci DEFAULT NULL,
  `esposa` tinyint(1) DEFAULT NULL,
  `hijos` int(11) DEFAULT NULL,
  `prenatal` tinyint(1) DEFAULT NULL,
  `escolaridad` int(11) DEFAULT NULL,
  `descuento_judicial` decimal(5,2) DEFAULT NULL,
  `version` int(11) DEFAULT NULL,
  `version_activa` tinyint(1) DEFAULT NULL COMMENT 'version activa o no del personal',
  `url_foto` varchar(256) COLLATE utf8_spanish_ci DEFAULT NULL COMMENT 'nombre de la foto',
  `estado_civil` int(11) DEFAULT NULL,
  `tipo_documento` int(11) DEFAULT NULL,
  `tipo_recibo` int(11) NOT NULL,
  `estado` int(11) DEFAULT NULL,
  `afjp` tinyint(1) DEFAULT NULL,
  `baja` date DEFAULT NULL,
  `telefono` varchar(45) COLLATE utf8_spanish_ci DEFAULT NULL,
  `celular` varchar(45) COLLATE utf8_spanish_ci DEFAULT NULL,
  `auditoria` bigint(20) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_personal_categoria1` (`categoria_principal`),
  KEY `fk_personal_obra_social1` (`obra_social`),
  KEY `fk_personal_fixedList1` (`estado_civil`),
  KEY `fk_personal_fixedList2` (`tipo_documento`),
  KEY `fk_personal_fixedList3` (`tipo_recibo`),
  KEY `fk_personal_fixedList4` (`estado`),
  KEY `fk_personal_auditoria1` (`auditoria`),
  CONSTRAINT `fk_personal_auditoria1` FOREIGN KEY (`auditoria`) REFERENCES `auditoria` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_categoria1` FOREIGN KEY (`categoria_principal`) REFERENCES `categoria` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_fixedList1` FOREIGN KEY (`estado_civil`) REFERENCES `fixedList` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_fixedList2` FOREIGN KEY (`tipo_documento`) REFERENCES `fixedList` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_fixedList3` FOREIGN KEY (`tipo_recibo`) REFERENCES `fixedList` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_fixedList4` FOREIGN KEY (`estado`) REFERENCES `fixedList` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_personal_obra_social1` FOREIGN KEY (`obra_social`) REFERENCES `obra_social` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=922 DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

